import { useState } from 'react';

function Counter2 () {
    const [count, setState] = useState(0);

    const handleIncrement = () => {
        setState(prevState => prevState + 1);
    }

    return (
        <div>
            <h1>{count}</h1>
            <button onClick={handleIncrement}>Increment</button>
        </div>
    )
}

export default Counter2
